function updateStudentGradeByCity(myStudents, city, newGrades) {
  const studFiltered = myStudents.filter((obj) => obj.location === city);
  // console.log(studFiltered);
  const result = studFiltered.map((obj) => {
    const grd = newGrades.find((greadObj) => greadObj.studentId === obj.id);
    if (grd) {
      obj.grade = grd.grade;
    } else {
      obj.grade = 'N/A';
    }
    return obj;
  });
  console.log(result);
}
// updateStudentGradeByCity(getListStudents(), 'San Francisco', [{ studentId: 5, grade: 97 }, { studentId: 1, grade: 86 }]);
// // updateStudentGradeByCity(getListStudents())
export default updateStudentGradeByCity;

